import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import { FaBars, FaTimes, FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Blog from "./Blog";
import Contact from "./Contact";
import YouTube from "./YouTube";

// Centralized Navigation and Social Links
const navigationItems = [
  { name: "Home", path: "/" },
  { name: "About", path: "/about" },
  { name: "Services", path: "/services" },
  { name: "Works", path: "/works" },
  { name: "Blog", path: "/blog" },
  { name: "YouTube", path: "/youtube" },
  { name: "Contact", path: "/contact" },
];

const socialLinks = [
  { icon: <FaLinkedin size={20} />, href: "https://www.linkedin.com/in/imchiranjeevi" },
  { icon: <FaGithub size={20} />, href: "https://github.com/your-profile" },
  { icon: <FaInstagram size={20} />, href: "https://www.instagram.com/_imchiranjeevi" },
];

export default function App() {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  // Close sidebar on resize to desktop view
  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth >= 768) setSidebarOpen(false);
    };
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <Router>
      <div className="flex min-h-screen bg-gray-50 text-gray-800 font-sans">
        {/* Overlay for mobile sidebar */}
        {sidebarOpen && (
          <div
            className="fixed inset-0 bg-gray-900 bg-opacity-60 z-10 md:hidden"
            onClick={() => setSidebarOpen(false)}
          />
        )}

        {/* Sidebar */}
        <aside
          className={`fixed top-0 left-0 h-full bg-gradient-to-b from-gray-900 to-gray-800 text-white w-64 p-6 flex flex-col justify-between shadow-lg z-20 transition-transform duration-300 ease-in-out ${
            sidebarOpen ? "translate-x-0" : "-translate-x-full"
          } md:translate-x-0`}
        >
          <div>
            <nav className="mt-4 space-y-1">
              {navigationItems.map((item) => (
                <NavLink
                  key={item.name}
                  to={item.path}
                  exact={item.path === "/"}
                  className={({ isActive }) =>
                    `block px-4 py-2 text-sm font-medium rounded-md transition-all duration-200 hover:bg-gray-700 hover:text-white ${
                      isActive ? "bg-gray-700 text-white" : "text-gray-300"
                    }`
                  }
                  onClick={() => setSidebarOpen(false)}
                >
                  {item.name}
                </NavLink>
              ))}
            </nav>
          </div>
          <div className="space-y-4">
            <div className="flex gap-4">
              {socialLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-400 hover:text-green-400 transition-colors duration-200 transform hover:scale-105"
                >
                  {link.icon}
                </a>
              ))}
            </div>
            <p className="text-gray-400 text-xs">
              © {new Date().getFullYear()} Chiranjeevi Kumar. All rights reserved.
            </p>
          </div>
        </aside>

        {/* Mobile Menu Toggle Button */}
        <button
          aria-label="Toggle sidebar"
          className="fixed top-4 left-4 z-30 p-2 bg-gray-900 rounded-lg shadow-md text-white hover:bg-gray-700 transition-colors duration-200 md:hidden"
          onClick={() => setSidebarOpen(!sidebarOpen)}
        >
          {sidebarOpen ? <FaTimes size={20} /> : <FaBars size={20} />}
        </button>

        {/* Main Content */}
        <main className="flex-1 p-6 md:p-12 lg:p-16 ml-0 md:ml-64 bg-white transition-all duration-300 overflow-y-auto">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/works" element={<Works />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/youtube" element={<YouTube />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}
